//원래 안써도 되지만
import React from 'react';
import Link from 'next/link';
import Head from 'next/head';
import 'antd/dist/antd.css'; // or 'antd/dist/antd.less'
import AppLayout from '../components/AppLayout';

// 훅스 문법 사용
const Home = () => {
	return (
		<>
			<Head>

			</Head>
			<AppLayout>
				<Link href="/about"><a>어바웃</a></Link>
				<div>Hello</div>
			</AppLayout>
		</>
	);
};

export default Home;
